import React from "react";
import ReactDOM from "react-dom";
import LandingPage from "./LandingPage"; // Assuming LandingPage component is in a file named LandingPage.js in the same directory

ReactDOM.render(
  <React.StrictMode>
    <LandingPage />
  </React.StrictMode>,
  document.getElementById("root") // Assuming you have a root element with id "root" in your index.html file
);
